module.exports = /*#__PURE__*/JSON.parse('[{"id":1,"title":"한 입 크기로 잘라 먹는 리액트","subTitle":"자바스크립트 기초부터 애플리케이션 배포까지","description":"자바스크립트 기초부터 애플리케이션 배포까지\\n처음 시작하기 딱 좋은 리액트 입문서\\n\\n이 책은 웹 개발에서 가장 많이 사용하는 프레임워크인 리액트 사용 방법을 소개합니다. 인프런, 유데미에서 5000여 명이 수강한 베스트 강좌를 책으로 엮었습니다. 프런트엔드 개발을 희망하는 사람들을 위해 리액트의 기본을 익히고 다양한 앱을 구현하는 데 부족함이 없도록 만들었습니다. \\n\\n자바스크립트 기초 지식이 부족해 리액트 공부를 망설이는 분, 프런트엔드 개발을 희망하는 취준생으로 리액트가 처음인 분, 퍼블리셔나 백엔드에서 프런트엔드로 직군 전환을 꾀하거나 업무상 리액트가 필요한 분, 뷰, 스벨트 등 다른 프레임워크를 쓰고 있는데, 실용적인 리액트를 배우고 싶은 분, 신입 개발자이지만 자바스크립트나 리액트 기초가 부족한 분에게 유용할 것입니다.","author":"이정환","publisher":"프로그래밍인사이트","coverImgUrl":"https://shopping-phinf.pstatic.net/main_3888828/38888282618.20230913071643.jpg"},{"id":2,"title":"러닝스쿨! 자바스크립트 첫걸음","subTitle":"처음 프로그래밍을 시작하는 입문자의 눈높이에 맞춘","description":"실무에 꼭 필요한 자바스크립트 필수 지식과 핵심 기술을 가장 쉽게 설명한 입문서!\\n\\n《러닝스쿨! 자바스크립트 첫걸음》은 자바스크립트의 기초부터 프런트엔드 개발의 최신 트렌드까지 웹 개발을 시작하려는 분들에게 필수적인 지식을 제공하는 책입니다. 현재 가장 인기 있는 기술인 React.js와 Next.js를 배우고 싶은 초보자부터, 이미 이 기술들을 다루고 있는 개발자 모두에게 적합합니다. \\n\\n실무에서 자주 사용되는 문법들을 위주로, 이해하기 쉬운 예제와 명확한 설명으로 기초적인 개념부터 심화 내용까지 단계별로 배울 수 있고, 이를 활용해 프로젝트를 개발하는 과정까지 다양한 예제와 친절한 설명으로 쉽게 이해할 수 있도록 도와주는 책입니다. 《러닝스쿨! 자바스크립트 첫걸음》을 통해 웹 개발에 첫걸음을 내딛어 보길 바랍니다.","author":"김효빈","publisher":"위키북스","coverImgUrl":"https://shopping-phinf.pstatic.net/main_4731061/47310617618.20240426090954.jpg"},{"id":7,"title":"이펙티브 타입스크립트","subTitle":"동작 원리의 이해와 구체적인 조언 62가지","description":"타입스크립트는 타입 정보를 지닌 자바스크립트의 상위 집합으로, 자바스크립트의 골치 아픈 문제점들을 해결해 준다. 이 책은 《이펙티브 C++》와 《이펙티브 자바》의 형식을 차용해 타입스크립트의 동작 원리, 해야 할 것과 하지 말아야 할 것에 대한 구체적인 조언을 62가지 항목으로 나누어 담았다.\\n각 항목의 조언을 실제로 적용한 예제를 통해 연습하다 보면 타입스크립트를 효율적으로 사용하는 방법을 익힐 수 있다. 타입스크립트를 기초적인 수준에서만 활용했다면 이 책을 통해 타입스크립트 전문가로 거듭나 보자.\\n\\n이 책에서 다루는 내용\\nㆍ 타입스크립트의 타입 시스템에 대한 자세한 이해\\nㆍ 안전하고 명료한 코드를 작성할 수 있는 타입 설계\\nㆍ 최소한의 타입 구문으로 완전한 안전성을 얻을 수 있는 타입 추론\\nㆍ any 타입의 전략적 사용\\nㆍ 의존성과 타입 선언 파일이 동작하는 원리\\nㆍ 자바스크립트를 타입스크립트로 마이그레이션하는 방법","author":"댄 밴더캄","publisher":"인사이트","coverImgUrl":"https://shopping-phinf.pstatic.net/main_3247334/32473346832.20221227204218.jpg"}]');

